import React, {useState} from "react";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import {makeStyles} from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
    paper: {
        marginTop: theme.spacing(8),
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
    },
    avatar: {
        margin: theme.spacing(1),
        backgroundColor: theme.palette.secondary.main,
    },
    form: {
        width: '100%', // Fix IE 11 issue.
        marginTop: theme.spacing(1),
        height:"100%",

    },
    signIn: {
        backgroundColor: "#00897b",
        '&:hover': {
            background: "#4db6ac",
        },
        margin: theme.spacing(3, 0, 2),
    },
    signUp: {
        backgroundColor: "#7b1fa2",
        '&:hover': {
            background: "#ab47bc",
        },
    },
    answers:{
        display:"flex",
        flexDirection:"row"
    },
    questions:{
        padding:"4px",
        minHeight:"400px",
        maxHeight:"600px",
        backgroundColor:"gray",
        borderRadius:"5px",
        overflowY:"scroll"
    }
}));

export default function CCForm(){
    const classes = useStyles();
    const [clubCreateForm, setClubCreateForm] = useState({
        clubName: "",
        question1: ""
    })

    return(
        <form className={classes.form}>
            <TextField
                variant="outlined"
                margin="normal"
                required
                fullWidth
                id="clubName"
                label="Club Name"
                name="clubName"
                autoComplete="clubName"
                autoFocus
                // value={user.username}
                // onChange={e => setUser({...user, username: e.target.value})}
            />
            <div className={classes.questions}>
                <TextField
                    variant="outlined"
                    margin="normal"
                    required
                    fullWidth
                    id="question1"
                    label="Question 1"
                    name="Question 1"
                    autoComplete="Question 1"
                    // value={user.username}
                    // onChange={e => setUser({...user, username: e.target.value})}
                />
                <div className={classes.answers}>
                    <TextField
                        variant="outlined"
                        margin="normal"
                        required
                        fullWidth
                        id="q1a1"
                        label="Answer"
                        name="q1a1"
                        autoComplete="q1a1"
                        // value={user.username}
                        // onChange={e => setUser({...user, username: e.target.value})}
                    />
                    <TextField
                        variant="outlined"
                        margin="normal"
                        required
                        fullWidth
                        id="q1a2"
                        label="Answer"
                        name="q1a2"
                        autoComplete="q1a2"
                        // value={user.username}
                        // onChange={e => setUser({...user, username: e.target.value})}
                    />
                    <TextField
                        variant="outlined"
                        margin="normal"
                        required
                        fullWidth
                        id="q1a3"
                        label="Answer"
                        name="q1a3"
                        autoComplete="q1a3"
                        // value={user.username}
                        // onChange={e => setUser({...user, username: e.target.value})}
                    />
                    <TextField
                        variant="outlined"
                        margin="normal"
                        required
                        fullWidth
                        id="q1a4"
                        label="Answer"
                        name="q1a4"
                        autoComplete="q1a4"
                        // value={user.username}
                        // onChange={e => setUser({...user, username: e.target.value})}
                    />
                    <TextField
                        variant="outlined"
                        margin="normal"
                        required
                        fullWidth
                        id="q1a5"
                        label="Answer"
                        name="q1a5"
                        autoComplete="q1a5"
                        // value={user.username}
                        // onChange={e => setUser({...user, username: e.target.value})}
                    />
                </div>
                <TextField
                    variant="outlined"
                    margin="normal"
                    required
                    fullWidth
                    id="question2"
                    label="Question 2"
                    name="Question 2"
                    autoComplete="Question 2"
                    // value={user.username}
                    // onChange={e => setUser({...user, username: e.target.value})}
                />
                <div className={classes.answers}>
                    <TextField
                        variant="outlined"
                        margin="normal"
                        required
                        fullWidth
                        id="q2a1"
                        label="Answer"
                        name="q2a1"
                        autoComplete="q2a1"
                        // value={user.username}
                        // onChange={e => setUser({...user, username: e.target.value})}
                    />
                    <TextField
                        variant="outlined"
                        margin="normal"
                        required
                        fullWidth
                        id="q2a2"
                        label="Answer"
                        name="q2a2"
                        autoComplete="q2a2"
                        // value={user.username}
                        // onChange={e => setUser({...user, username: e.target.value})}
                    />
                    <TextField
                        variant="outlined"
                        margin="normal"
                        required
                        fullWidth
                        id="q2a3"
                        label="Answer"
                        name="q2a3"
                        autoComplete="q2a3"
                        // value={user.username}
                        // onChange={e => setUser({...user, username: e.target.value})}
                    />
                    <TextField
                        variant="outlined"
                        margin="normal"
                        required
                        fullWidth
                        id="q2a4"
                        label="Answer"
                        name="q2a4"
                        autoComplete="q2a4"
                        // value={user.username}
                        // onChange={e => setUser({...user, username: e.target.value})}
                    />
                    <TextField
                        variant="outlined"
                        margin="normal"
                        required
                        fullWidth
                        id="q2a5"
                        label="Answer"
                        name="q2a5"
                        autoComplete="q2a5"
                        // value={user.username}
                        // onChange={e => setUser({...user, username: e.target.value})}
                    />
                </div>
                <TextField
                    variant="outlined"
                    margin="normal"
                    required
                    fullWidth
                    id="question3"
                    label="Question 3"
                    name="Question 3"
